INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Qui repellendus voluptas ut temporibus perferendis delectus et.', 'Eaque aspernatur eos neque corrupti qui ea velit dolore. Voluptatem ipsa similique aut officia doloremque earum eum. Ab consequatur distinctio eos quis incidunt laboriosam facere velit. Nulla vero amet rerum enim odit odit.', 'Consequatur aut repellat dolorum quis. Voluptatem aliquam architecto qui veniam laudantium sed non. Consequuntur ea laboriosam est omnis. Perferendis sint reiciendis velit sed.', '1977-08-20');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'At tempora nihil omnis commodi ut consectetur cumque.', 'Sint occaecati porro et tempora dignissimos ea. Nesciunt sequi unde iure ea facilis unde est asperiores.', 'Aut qui illo repellendus. Distinctio eos doloremque ea voluptatem qui. Excepturi eum temporibus et et quo quia eum.', '1974-06-21');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Quia error quia numquam et.', 'Distinctio quia molestiae sunt dolore eum voluptas. Assumenda ea consequuntur beatae.', 'Sed dignissimos debitis ut quod at quia eum. Quia dolor quam qui exercitationem consequatur occaecati a. Cumque dolor voluptatibus dolore saepe quos explicabo.', '2013-12-29');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Omnis assumenda velit at ex placeat.', 'Voluptate aliquam in laborum mollitia maxime dolorem. Optio optio qui sint quo praesentium eligendi explicabo. Id eum pariatur rerum libero nesciunt. Placeat animi quae omnis veniam unde modi nemo quibusdam.', 'Est aliquid ipsa minima totam. Sit soluta maxime corrupti qui nihil. Laboriosam assumenda eos est consequatur. Quia odit sed consequatur illum explicabo.', '2008-07-30');
